    // Layer 4: Conv2D
    constexpr std::array<Scalar, 72> convKernel_4 = {-1.749677770e-02, 2.260016501e-01, 1.172363162e-01, 2.514218390e-01, 1.364832819e-01, 8.897319436e-03, 4.538849369e-02, -1.562034786e-01, -3.082260676e-02, -1.175935343e-01, -3.194784280e-03, 1.278290898e-01, 2.607488036e-01, -8.208124340e-02, 3.079865575e-01, -1.632554531e-01, -4.873766378e-02, -1.393661350e-01, 1.476755440e-01, -9.775770456e-02, 1.714762487e-02, 6.028705835e-02, -1.298730522e-01, 8.495158702e-02, 4.202184454e-02, -1.228734404e-01, -2.129463293e-02, -1.978276521e-01, -6.414176524e-02, 1.226755381e-01, -1.117087081e-01, -1.528812647e-01, 1.936984621e-02, 3.236236423e-02, 2.048232108e-01, -3.782148659e-02, 4.761443287e-02, -1.004329547e-01, -9.599284828e-02, 2.141363919e-02, -1.851855963e-01, -1.493718922e-01, 2.111001462e-01, 3.592841327e-02, -8.776336908e-02, -1.190511882e-01, -1.724807769e-01, 6.444932520e-02, 2.233978659e-01, -1.111009121e-01, -1.559044868e-01, 1.243625581e-01, -1.506243646e-01, -1.157856639e-02, 7.896721363e-02, 9.658218920e-02, -6.889334880e-03, -1.465868950e-01, 1.598707214e-02, 9.376092255e-02, 1.609402336e-02, -1.512672752e-01, -1.645799428e-01, -1.165329143e-01, 2.316346467e-01, 2.200275473e-02, 6.137697399e-02, -1.040259078e-01, -1.080496386e-01, -1.675341576e-01, 3.482801095e-02, -1.791822761e-01};
    constexpr std::array<Scalar, 1> convBias_4 = {-1.369949430e-03};


